import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';


const Header = () =>(
    <header id="main-header">
              <ul>
              <li>
                  <Link to={'/'}>Home</Link>
                </li>
                <li className="nav-item">
                  <Link to={'/create'}>Create</Link>
                </li>
                <li className="nav-item">
                  <Link to={'/index'}>Index</Link>
                </li>
              </ul>
      </header>
);

export default Header;
